import React from 'react';
import 'owl.carousel/dist/assets/owl.carousel.css';
import 'owl.carousel/dist/assets/owl.theme.default.css';
import OwlCarousel from 'react-owl-carousel';
import 'bootstrap/dist/css/bootstrap.css';
import '../css/style.css';

const Carousel = () => {
    const options = {
        loop: true,
        margin: 10,
        nav: true,
        items: 1,
        autoplay: true,
        autoplayTimeout: 5000,
        animateOut: 'fadeOut',
        animateIn: 'fadeIn',
        dots: true,
        dotsData: true
    };

    return (
        <div className="container-fluid p-0 pb-5 wow fadeIn" data-wow-delay="0.1s">
            <OwlCarousel className="owl-carousel header-carousel position-relative" {...options}>
                <div className="owl-carousel-item position-relative" data-dot="<img src='img/bg7.jpg'>">
                    <img className="img-fluid" src="img/bg7.jpg" alt="" />
                    <div className="owl-carousel-inner">
                        <div className="container">
                            <div className="row justify-content-start">
                                <div className="col-10 col-lg-8">
                                    <h5 className="display-3 text-white animated slideInDown">TO MEET CUSTOMERS NEEDS IS OUR RESPONSIBILITY</h5>
                                    <p className="fs-5 fw-medium text-white mb-4 pb-3">The company specializes in the Powder coating & anodizing of aluminium.</p>
                                    <a href="/" className="btn btn-secondary py-3 px-5 animated slideInLeft">Read More</a>
                                </div>
                            </div>
                        </div>
                    </div>
                </div>
            </OwlCarousel>
        </div>
    );
};

export default Carousel;
